import { Link } from "react-router-dom";

export const Navbar = () => {
  return (
    <div>
      <nav style={{ display: "flex", justifyContent: "space-around" }}>
        <Link to="/">Home</Link>
        <Link to="/todolist/ABC">Find a Workout</Link>
        <Link to="/todolist/DEF">Meet Others</Link>
        <Link to="">Profile</Link>
      </nav>
    </div>
  );
};
